import React, { useState } from 'react';

function TaskForm() {

    const [task, setTask] = useState({
        taskID: "DLNVDLV09030",
        name: "Finish Project",
        description: "Complete the final project report and submit it.",
        dueDate: "2024-10-05",
        timeStart: "10:00 AM",
        timeEnd: "12:00 PM",
        allDay: "Yes"
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setTask((prevTask) => ({
            ...prevTask,
            [name]: value,
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log("Submitted Task:", task);
        setShowModal(false);
    };

    const handleAllDayChange = (e) => {
        const isChecked = e.target.checked;
        setAllDay(isChecked);

        if (isChecked) {
            handleChange({ target: { name: 'timeStart', value: '00:00' } });
            handleChange({ target: { name: 'timeEnd', value: '23:59' } });
        } else {
            handleChange({ target: { name: 'timeStart', value: '' } });
            handleChange({ target: { name: 'timeEnd', value: '' } });
        }
    };

    return (
        <>
            <div className="modal show" style={{ display: 'block' }} >
                <div className="modal-dialog modal-dialog-centered" role="document">
                    <div className="modal-content">
                        <div className="modal-header d-flex justify-content-between">
                            <h5 className="modal-title">Create Task</h5>
                            <button type="button" className="close" onClick={handleClose}>
                                <span>&times;</span>
                            </button>
                        </div>
                        <form onSubmit={handleSubmit}>
                            <div className="modal-body">
                                <div className="form-group">
                                    <label className='d-flex justify-content-between m-2'>Task Name</label>
                                    <input
                                        type="text"
                                        id="taskName"
                                        name="name"
                                        value={task.name}
                                        onChange={handleChange}
                                        className="form-control"
                                        required
                                    />
                                </div>
                                <div className="form-group">
                                    <label className='d-flex justify-content-between m-2'>Description</label>
                                    <textarea
                                        id="taskDescription"
                                        name="description"
                                        value={task.description}
                                        onChange={handleChange}
                                        className="form-control"
                                        required
                                    />
                                </div>
                                <div className="form-group">
                                    <label className='d-flex justify-content-between m-2'>Schedule Date</label>
                                    <input
                                        type="date"
                                        id="taskDueDate"
                                        name="dueDate"
                                        value={task.dueDate}
                                        onChange={handleChange}
                                        className="form-control"
                                        required
                                    />
                                </div>
                                <div className="form-group">
                                    <label className='d-flex justify-content-between m-2'>Start Time</label>
                                    <input
                                        type="time"
                                        id="timeStart"
                                        name="timeStart"
                                        value={task.timeStart}
                                        onChange={handleChange}
                                        className="form-control"
                                        disabled={allDay}
                                    />
                                </div>
                                <div className="form-group">
                                    <label className='d-flex justify-content-between m-2'>End Time</label>
                                    <input
                                        type="time"
                                        id="timeEnd"
                                        name="timeEnd"
                                        value={task.timeEnd}
                                        onChange={handleChange}
                                        className="form-control"
                                        disabled={allDay} 
                                    />
                                </div>
                                <div className="form-group">
                                    <label className='d-flex m-2'>
                                    All Day
                                    <input
                                        type="checkbox"
                                        id="allDay"
                                        name="allDay"
                                        checked={allDay}
                                        onChange={handleAllDayChange}
                                        className="form-check-input border me-4"
                                    />
                                    </label>
                                </div>
                            </div>
                            <div className="modal-footer d-flex justify-content-between">
                                <button type="button" className="btn btn-secondary" onClick={handleClose}>Cancel</button>
                                <button type="submit" className="btn btn-primary">Create Task</button>
                            </div>
                        </form>
                    </div>
                </div>
            </div>
        </>
    );
}

export default TaskForm;
